import { Input } from "components";
import React from "react";

export const LoginForm = () => {
  return (
    <div className="b">
      <form className="row g-3">
       <Input/>
       <Input/>
        <div className="col-12">
          <button className="btn btn-primary" type="submit">
            Submit form
          </button>
        </div>
      </form>
    </div>
  );
};
